import React from "react";
import { Link } from "react-router-dom";

export function NavBar() {
    return (
        <nav className="navbar bg-dark">
            <div className="container-fluid">
                <Link to="/" className="navbar-brand text-light mb-0 h-1">Benim Kod</Link>
                <ul className="navbar-nav me-auto mb-2 mb-lg-0">
                    <li className="navbar-item">
                        <Link to="/" className="nav-link text-light m-1 h-1">Ana Sayfa</Link>
                        <Link to="/course" className="nav-link text-light m-1 h-1">Korslar</Link>
                        <Link to="/blog" className="navbar-item text-light m-1 h-1">Blog</Link>
                        <Link to="/about" className="navbar-item text-light m-1 h-1">About</Link>
                        <Link to="/contactus" className="navbar-item text-light m-1 h-1">Contact With Us</Link>
                    </li>
                </ul>
            </div>
        </nav>
    )
}
